import React from 'react';
import './login.css';




function Login() {
  return (
      <div className="login">
           <div className="login-container">
           <form action="">
                 <div className="logininp">
                     <label htmlFor="">Email </label>
                     <input type="text" />
                 </div>
             </form>
           </div>
      </div>
  );
}

export default Login;
